    <p className="fonts" style={{fontFamily:"'Satisfy', cursive"}}>I'm a Web,   MERN, React Developer</p>
    </div>


    <div className="md-6 col text-center">
    <Image src={`${Color === "light" ? "/images/Componentblack.png": "/images/Componentwhite.png"}`} alt="no image to preview" class="rounded-circle  image "/>
    <div className="text-center ">
    <button type="button" class="btn btn-secondary bg-dark">Download Resume</button>
    </div>
    </div>
    
    </div>
)


};

export default HomePage;
